import { useNavigate } from 'react-router-dom'
import '../../css/auth.css'
import React from 'react'



export const Login = () =>{
    const navigate = useNavigate()
    let angle = 0
    const panelStyle= {
        transform: 'rotate((angle)deg)'
    }
    setInterval(()=>{angle++},100)
    return (
        <div className='flex panel' style={panelStyle}>
            <h1>WebShell</h1>
            <label>Логин</label>
            <input className = 'input' />
            <label>Пароль</label>
            <input className = 'input' />
            <button  className='button login' onClick={()=>{navigate('/console')}}>Отправить </button>
            <button className='button register'  onClick={() => window.location.href='http://localhost:3000/register'}>Регистрация </button>
        </div>
    );
}
